import 'bootstrap/dist/js/bootstrap.min';
import Row from 'react-bootstrap/Row';
import Col from 'react-bootstrap/Col';
import Navbar from 'react-bootstrap/Navbar';
import Nav from 'react-bootstrap/Nav';
import Container from 'react-bootstrap/Container';
import ListGroup from 'react-bootstrap/ListGroup';

import {
  Route,
  NavLink,
  BrowserRouter
} from "react-router-dom";
import AreaChart from "./area charts/Area Chart";

class Widget extends Component{
    render(){
        return(
            <div className="cont">
            <p>Salut je m'appelle lélé </p>
            <Button>HELLO JE SUIS UN WIDGET</Button>
            <Route path="/area-chart" component={AreaChart}/>
            <img src="https://archzine.fr/wp-content/uploads/2016/01/image-de-neige-fond-d-ecran-montagne-maison-cosy.jpg" alt="salut"></img>
          </div>
        );
    }



}


export default Widget;
